import React,{Component} from 'react';
import 'tachyons';
import './Nav.scss';
import { HashLink as Link } from 'react-router-hash-link';
import  {ReactComponent as LogoDebugged} from './debuggedlogo.svg';

const Nav =({onRouteChange,route})=>
{
    return (
      <div>
      <div className="topnav">
      <div className="mt0">

      </div>
       &nbsp;
       <div className="navhead">
        <Link to='/' ><span className="white nav left ul f4 pa2 tc">Home</span></Link>
        <Link to='/#about'><span className="white nav left ul f4 pa2 tc">About Us</span></Link>
        <Link to='/work'><span className="white nav left ul f4 pa2 tc">Work</span></Link>
        <Link to='/contact'><span className="white nav left ul f4 pa2 tc">Contact Us</span></Link>
       </div>
     </div>
     </div>

    );
  }

export default Nav;
